import { Row } from "react-bootstrap";

function Tweet(props) {
  const tweetText = props.text;
  const username = props.username;
  const date = props.dateCreated;

  console.log(date);

  return (
    <div className="tweet-container mb-5">
      <Row className="justif">
        <span>{username}</span>

        <span>{date}</span>
      </Row>
      <Row>{tweetText}</Row>
    </div>
  );
}
export default Tweet;
